import React from "react"
import { css } from "aphrodite/no-important"
import styles from './styles'

type SearchPresentProps = {
  data: any
  formik: any
}

export const SearchPresent: React.FC<SearchPresentProps> = ({ data, formik }) => {

  console.log(data, formik)

  return <div className={ css(styles.wrapper) }>
    <input
      type="text"

    />

    { data.length !== 0 ? <select className={ css(styles.select) } size={ data.length } id='description' name='description' >
      { status === 'OK' && data.map((value, index) => {
        return <option className={ css(styles.option) } key={index} value={value.description}>{value.description}</option>
      }) }
    </select> : null }
  </div>
}
